import './App.css';

function App() {
  const title = "Welcome to the new blog";
  const likes = 47;
  const person = {name: "Matias", age:18};
  const link = "http://www.google.com";

  return (
    <div className="App">
      <div className="content"> 
        <h1> {title} </h1>
        <p> Liked <b>{likes}</b> times </p>
        <p>Name: <b>{person.name}</b>, age: <b>{person.age}</b></p>
      </div>

    </div>
  );
}

export default App;
